import React, { Component } from 'react';
function Menu(){
 return (
 <p>
 Menu:
 <ul>
 <li><a href="/profile">Profile</a></li>
    <ul>
    <li><a href="/proyek/web-app">Galeri Produk</a></li>
    <li><a href="/proyek/mobile-app">Pemesanan</a></li>
    </ul>
 </ul>
 </p>
 );
}
class Proyek extends Component{
 render(){
 return (
 <div>
 <h1>Produk</h1>
 <p>Berikut adalah daftar produk yang kami sediakan:</p>
 <p>Jika anda tertarik silahkan lakukan pengisian form</p>
 <ul>
 <li><a href="/proyek/mobile-app">Pemesanan</a></li>
 </ul>
 <p>Jika barang yang anda cari belum tersedia dalam galeri kami silahkan hubungi admin dibawah ini</p>
 <p>Nohp/Wa: 083847889439</p>
 <p>Email: Jayashop@gmail.com</p>
 <hr />
 <Menu />
 </div>
 )
 }
}
export default Proyek;
